module.exports = {
  root: true,
  extends: ['plugin:prettier/recommended'],
  plugins: ['@nx', 'prefer-arrow', 'import', 'unused-imports', 'unicorn'],
  rules: {
    'func-style': ['error', 'declaration', { allowArrowFunctions: true }],
    'no-console': ['warn', { allow: ['group', 'groupCollapsed', 'groupEnd'] }],
    'no-control-regex': 0,
    'no-debugger': 'error',
    'no-duplicate-imports': 'error',
    'no-undef': 'off',
    'no-unused-vars': 'off',

    '@nx/enforce-module-boundaries': [
      'error',
      {
        enforceBuildableLibDependency: true,
        allow: [],
        depConstraints: [
          {
            sourceTag: 'scope:shared',
            onlyDependOnLibsWithTags: ['scope:shared'],
          },
          {
            sourceTag: 'scope:backend',
            onlyDependOnLibsWithTags: ['scope:shared', 'scope:backend'],
          },
          {
            sourceTag: 'scope:frontend',
            onlyDependOnLibsWithTags: ['scope:shared', 'scope:frontend'],
          },
          {
            sourceTag: 'scope:zapier',
            onlyDependOnLibsWithTags: ['scope:shared'],
          },
        ],
      },
    ],

    'import/no-relative-packages': 'error',
    'import/no-useless-path-segments': 'error',
    'import/no-duplicates': ['error', { considerQueryString: true }],

    'prefer-arrow/prefer-arrow-functions': [
      'error',
      {
        disallowPrototype: true,
        singleReturnOnly: false,
        classPropertiesAllowed: false,
      },
    ],

    'unused-imports/no-unused-imports': 'warn',
    'unused-imports/no-unused-vars': [
      'warn',
      {
        vars: 'all',
        varsIgnorePattern: '^_',
        args: 'after-used',
        argsIgnorePattern: '^_',
      },
    ],
  },
  overrides: [
    {
      files: ['**/*.ts', '**/*.tsx'],
      extends: ['plugin:@nx/typescript'],
      rules: {
        '@typescript-eslint/ban-ts-comment': 'error',
        '@typescript-eslint/consistent-type-imports': [
          'error',
          { prefer: 'no-type-imports' },
        ],
        '@typescript-eslint/explicit-function-return-type': 'off',
        '@typescript-eslint/explicit-module-boundary-types': 'off',
        '@typescript-eslint/interface-name-prefix': 'off',
        '@typescript-eslint/no-empty-function': 'off',
        '@typescript-eslint/no-empty-interface': [
          'error',
          {
            allowSingleExtends: true,
          },
        ],
        '@typescript-eslint/no-explicit-any': 'off',
        '@typescript-eslint/no-empty-function': 'off',
        '@typescript-eslint/no-unused-vars': [
          'warn',
          {
            vars: 'all',
            varsIgnorePattern: '^_',
            args: 'after-used',
            argsIgnorePattern: '^_',
          },
        ],
      },
    },
    {
      files: ['*.js', '*.jsx'],
      extends: ['plugin:@nx/javascript'],
      rules: {},
    },
    {
      files: [
        '*.spec.@(ts|tsx|js|jsx)',
        '*.integration-spec.@(ts|tsx|js|jsx)',
        '*.test.@(ts|tsx|js|jsx)',
      ],
      env: {
        jest: true,
      },
      rules: {
        '@typescript-eslint/no-non-null-assertion': 'off',
      },
    },
    {
      files: ['**/constants/*.ts', '**/*.constants.ts'],
      rules: {
        '@typescript-eslint/naming-convention': [
          'error',
          {
            selector: 'variable',
            format: ['UPPER_CASE'],
          },
        ],
        'unicorn/filename-case': [
          'warn',
          {
            cases: {
              pascalCase: true,
            },
          },
        ],
        '@nx/workspace-max-consts-per-file': ['error', { max: 1 }],
      },
    },
    {
      files: ['*.json'],
      parser: 'jsonc-eslint-parser',
    },
  ],
};

var path = require('path');

module.exports = {
  extends: [
    'plugin:@nx/react',
    'plugin:react/recommended',
    'plugin:react-hooks/recommended',
    'plugin:storybook/recommended',
  ],
  plugins: ['react-hooks', 'react-refresh'],
  overrides: [
    {
      files: ['*.ts', '*.tsx'],
      parserOptions: {
        project: ['./tsconfig.base.{json,*.json}'],
      },
      rules: {
        'no-restricted-imports': [
          'error',
          {
            patterns: [
              {
                group: ['@tabler/icons-react'],
                message: 'Please import icons from `twenty-ui`',
              },
              {
                group: ['react-hotkeys-web-hook'],
                importNames: ['useHotkeys'],
                message:
                  'Please use the custom wrapper: `useScopedHotkeys` from `twenty-ui`',
              },
              {
                group: ['lodash'],
                message:
                  "Please use the standalone lodash package (for instance: `import groupBy from 'lodash.groupby'` instead of `import { groupBy } from 'lodash'`)",
              },
            ],
          },
        ],
        '@nx/workspace-effect-components': 'error',
        '@nx/workspace-no-hardcoded-colors': 'error',
        '@nx/workspace-matching-state-variable': 'error',
        '@nx/workspace-sort-css-properties-alphabetically': 'error',
        '@nx/workspace-styled-components-prefixed-with-styled': 'error',
        '@nx/workspace-no-state-useref': 'error',
        '@nx/workspace-component-props-naming': 'error',
        '@nx/workspace-explicit-boolean-predicates-in-if': 'error',
        '@nx/workspace-use-getLoadable-and-getValue-to-get-atoms': 'error',
        '@nx/workspace-useRecoilCallback-has-dependency-array': 'error',
        '@nx/workspace-no-navigate-prefer-link': 'error',
        'react/no-unescaped-entities': 'off',
        'react/prop-types': 'off',
        'react/jsx-key': 'off',
        'react/display-name': 'off',
        'react/jsx-uses-react': 'off',
        'react/react-in-jsx-scope': 'off',
        'react/jsx-no-useless-fragment': 'off',
        'react/jsx-props-no-spreading': [
          'error',
          {
            explicitSpread: 'ignore',
          },
        ],
        'react-hooks/exhaustive-deps': [
          'warn',
          {
            additionalHooks: 'useRecoilCallback',
          },
        ],
      },
    },
    {
      files: ['*.stories.@(ts|tsx|js|jsx)'],
      rules: {
        '@typescript-eslint/no-non-null-assertion': 'off',
      },
    },
    {
      files: ['.storybook/main.@(js|cjs|mjs|ts)'],
      rules: {
        'storybook/no-uninstalled-addons': [
          'error',
          {
            packageJsonLocation: path.resolve(__dirname, './package.json'),
          },
        ],
      },
    },
  ],
};

{
  "singleQuote": true,
  "trailingComma": "all",
  "endOfLine": "auto"
}

import { getJestProjects } from '@nx/jest';

export default {
  projects: getJestProjects(),
};

#!/bin/bash
command -v node >/dev/null 2>&1 || { echo >&2 "Nx requires NodeJS to be available. To install NodeJS and NPM, see: https://nodejs.org/en/download/ ."; exit 1; }
command -v npm >/dev/null 2>&1 || { echo >&2 "Nx requires npm to be available. To install NodeJS and NPM, see: https://nodejs.org/en/download/ ."; exit 1; }
path_to_root=$(dirname $BASH_SOURCE)
node $path_to_root/.nx/nxw.js $@

{
  "namedInputs": {
    "default": ["{projectRoot}/**/*"],
    "excludeStories": [
      "default",
      "!{projectRoot}/.storybook/*",
      "!{projectRoot}/**/tsconfig.storybook.json",
      "!{projectRoot}/**/*.stories.(ts|tsx)",
      "!{projectRoot}/**/__stories__/*"
    ],
    "excludeTests": [
      "default",
      "!{projectRoot}/**/jest.config.(js|ts)",
      "!{projectRoot}/**/tsconfig.spec.json",
      "!{projectRoot}/**/*.test.(ts|tsx)",
      "!{projectRoot}/**/*.spec.(ts|tsx)",
      "!{projectRoot}/**/*.integration-spec.ts",
      "!{projectRoot}/**/__tests__/*"
    ],
    "production": [
      "default",
      "excludeStories",
      "excludeTests",
      "!{projectRoot}/**/__mocks__/*",
      "!{projectRoot}/**/testing/*"
    ]
  },
  "targetDefaults": {
    "build": {
      "cache": true,
      "inputs": ["^production", "production"],
      "dependsOn": ["^build"]
    },
    "start": {
      "cache": true,
      "dependsOn": ["^build"]
    },
    "lint": {
      "executor": "@nx/eslint:lint",
      "cache": true,
      "outputs": ["{options.outputFile}"],
      "options": {
        "eslintConfig": "{projectRoot}/.eslintrc.cjs",
        "cache": true,
        "cacheLocation": "{workspaceRoot}/.cache/eslint",
        "ignorePath": "{workspaceRoot}/.gitignore"
      },
      "configurations": {
        "ci": { "cacheStrategy": "content" },
        "fix": { "fix": true }
      },
      "dependsOn": ["^build"]
    },
    "fmt": {
      "executor": "nx:run-commands",
      "cache": true,
      "options": {
        "cwd": "{projectRoot}",
        "command": "prettier {args.files} --check --cache {args.cache} --cache-location {args.cacheLocation} --write {args.write} --cache-strategy {args.cacheStrategy}",
        "cache": true,
        "cacheLocation": "../../.cache/prettier/{projectRoot}",
        "cacheStrategy": "metadata",
        "write": false
      },
      "configurations": {
        "ci": { "cacheStrategy": "content" },
        "fix": { "write": true }
      },
      "dependsOn": ["^build"]
    },
    "typecheck": {
      "executor": "nx:run-commands",
      "cache": true,
      "options": {
        "cwd": "{projectRoot}",
        "command": "tsc -b tsconfig.json --incremental"
      },
      "configurations": {
        "watch": { "watch": true }
      },
      "dependsOn": ["^build"]
    },
    "test": {
      "executor": "@nx/jest:jest",
      "cache": true,
      "dependsOn": ["^build"],
      "inputs": [
        "^default",
        "excludeStories",
        "{workspaceRoot}/jest.preset.js"
      ],
      "outputs": ["{projectRoot}/coverage"],
      "options": {
        "jestConfig": "{projectRoot}/jest.config.ts",
        "coverage": true,
        "coverageReporters": ["text-summary"],
        "cacheDirectory": "../../.cache/jest/{projectRoot}"
      },
      "configurations": {
        "ci": {
          "ci": true,
          "maxWorkers": 3
        },
        "coverage": { "coverageReporters": ["lcov", "text"] },
        "watch": { "watch": true }
      }
    },
    "test:e2e": {
      "cache": true,
      "dependsOn": ["^build"]
    },
    "storybook:build": {
      "executor": "nx:run-commands",
      "cache": true,
      "inputs": ["^default", "excludeTests"],
      "outputs": ["{projectRoot}/{options.output-dir}"],
      "options": {
        "cwd": "{projectRoot}",
        "command": "VITE_DISABLE_TYPESCRIPT_CHECKER=true VITE_DISABLE_ESLINT_CHECKER=true storybook build --test",
        "output-dir": "storybook-static",
        "config-dir": ".storybook"
      },
      "dependsOn": ["^build"]
    },
    "storybook:serve:dev": {
      "executor": "nx:run-commands",
      "cache": true,
      "dependsOn": ["^build"],
      "options": {
        "cwd": "{projectRoot}",
        "command": "storybook dev",
        "config-dir": ".storybook"
      }
    },
    "storybook:serve:static": {
      "executor": "nx:run-commands",
      "dependsOn": ["storybook:build"],
      "options": {
        "cwd": "{projectRoot}",
        "command": "npx http-server {args.staticDir} -a={args.host} --port={args.port} --silent={args.silent}",
        "staticDir": "storybook-static",
        "host": "localhost",
        "port": 6006,
        "silent": true
      }
    },
    "storybook:test": {
      "executor": "nx:run-commands",
      "cache": true,
      "inputs": ["^default", "excludeTests"],
      "outputs": ["{projectRoot}/coverage/storybook"],
      "options": {
        "cwd": "{projectRoot}",
        "commands": [
          "test-storybook --url http://localhost:{args.port} --maxWorkers=3 --coverage --coverageDirectory={args.coverageDir} --shard={args.shard}",
          "nx storybook:coverage {projectName} --coverageDir={args.coverageDir} --checkCoverage={args.checkCoverage}"
        ],
        "shard": "1/1",
        "parallel": false,
        "coverageDir": "coverage/storybook",
        "port": 6006,
        "checkCoverage": true
      }
    },
    "storybook:test:no-coverage": {
      "executor": "nx:run-commands",
      "inputs": ["^default", "excludeTests"],
      "options": {
        "cwd": "{projectRoot}",
        "commands": [
          "test-storybook --url http://localhost:{args.port} --maxWorkers=2"
        ],
        "port": 6006
      }
    },
    "storybook:coverage": {
      "executor": "nx:run-commands",
      "cache": true,
      "inputs": [
        "^default",
        "excludeTests",
        "{projectRoot}/coverage/storybook/coverage-storybook.json"
      ],
      "outputs": [
        "{projectRoot}/coverage/storybook",
        "!{projectRoot}/coverage/storybook/coverage-storybook.json"
      ],
      "options": {
        "command": "npx nyc report --reporter={args.reporter} --reporter=text-summary -t {args.coverageDir} --report-dir {args.coverageDir} --check-coverage={args.checkCoverage} --cwd={projectRoot}",
        "coverageDir": "coverage/storybook",
        "reporter": "lcov",
        "checkCoverage": true
      },
      "configurations": {
        "text": { "reporter": "text" }
      }
    },
    "storybook:serve-and-test:static": {
      "executor": "nx:run-commands",
      "options": {
        "commands": [
          "npx concurrently --kill-others --success=first -n SB,TEST 'nx storybook:serve:static {projectName} --port={args.port}' 'npx wait-on tcp:{args.port} && nx storybook:test {projectName} --shard={args.shard} --checkCoverage={args.checkCoverage} --port={args.port} --configuration={args.scope}'"
        ],
        "shard": "1/1",
        "checkCoverage": true,
        "port": 6006
      }
    },
    "chromatic": {
      "executor": "nx:run-commands",
      "options": {
        "cwd": "{projectRoot}",
        "commands": [
          {
            "command": "nx storybook:build {projectName}",
            "forwardAllArgs": false
          },
          "cross-var chromatic --project-token=$CHROMATIC_PROJECT_TOKEN --storybook-build-dir=storybook-static {args.ci}"
        ],
        "parallel": false
      },
      "configurations": {
        "ci": {
          "ci": "--exit-zero-on-changes"
        }
      }
    },
    "@nx/jest:jest": {
      "cache": true,
      "inputs": [
        "^default",
        "excludeStories",
        "{workspaceRoot}/jest.preset.js"
      ],
      "options": {
        "passWithNoTests": true
      },
      "configurations": {
        "ci": {
          "ci": true,
          "codeCoverage": true
        }
      }
    },
    "@nx/eslint:lint": {
      "cache": true,
      "inputs": [
        "default",
        "{workspaceRoot}/.eslintrc.js",
        "{workspaceRoot}/tools/eslint-rules/**/*"
      ]
    },
    "@nx/vite:test": {
      "cache": true,
      "inputs": ["default", "^default"]
    },
    "@nx/vite:build": {
      "cache": true,
      "dependsOn": ["^build"],
      "inputs": ["default", "^default"]
    }
  },
  "installation": {
    "version": "18.3.3"
  },
  "generators": {
    "@nx/react": {
      "application": {
        "style": "@emotion/styled",
        "linter": "eslint",
        "bundler": "vite",
        "compiler": "swc",
        "unitTestRunner": "jest",
        "projectNameAndRootFormat": "derived"
      },
      "library": {
        "style": "@emotion/styled",
        "linter": "eslint",
        "bundler": "vite",
        "compiler": "swc",
        "unitTestRunner": "jest",
        "projectNameAndRootFormat": "derived"
      },
      "component": {
        "style": "@emotion/styled"
      }
    }
  },
  "tasksRunnerOptions": {
    "default": {
      "options": {
        "cacheableOperations": ["storybook:build"]
      }
    }
  },
  "useInferencePlugins": false,
  "defaultBase": "main"
}
